'use strict';

const Container = require('postcss-values-parser/lib/container');
const Node = require('postcss-values-parser/lib/node');

class UnicodeRange extends Node {
  constructor (opts) {
    super(opts);
    this.type = 'unicode-range';
  }
}

Container.registerWalker(UnicodeRange);

module.exports = UnicodeRange;
